import React, { Component } from 'react'; 
import { Layout, Row, Col, Button, Input} from 'antd'; 
import '../assets/css/portofolio.css' 

const { Content } = Layout; // membuat konstanta content 

class KmsComponent extends Component{
    render(){
        return(
            <Layout className="landing-container">
                <Content style={{ 
                    overflow: "hidden",
                    padding:15,
                    minHeight:280,
                    borderRadius:"8px",
                    }}
                > 
                    <Row className="section-container">
                            <Col lg={24}>
                                <hr style={{
                                    minHeight: 8,
                                    backgroundColor: '#7d5e2a',
                                    border: 'none',
                                    maxWidth: 150,
                                    borderRadius: 26,
                                }}/>
                            </Col>                    
                            <Col lg={24} className="mt-20">

                                <br></br>
                                <br></br>
                                <div>
                                    <Button className="" type="primary" onClick={this.handleAdd}>Batal</Button>
                                    <Button className="" type="primary" onClick={this.handleAdd}>Simpan Data</Button>
                                </div>
                            </Col>
                        </Row>
                </Content>
            </Layout>
        );
    }
}

export default KmsComponent;
